const LanguageTranslationTool = () => {
    const [languageTool,setLanguageTool] = useState({
        sourceLanguage:'telugu',
        targetlanguage:'English',
        
    })
    return <div>
       <ul>

            {Object.values(languageTool).map((val)=> <li>{val}</li> )}
        </ul>
    </div>
};


export default LanguageTranslationTool
